import { useState, useEffect } from "react";

function App() {

  const [loading, setLoading] = useState(true);
  const [movies, setMovies] = useState([]);

  const getMovies = async() => {
    getMovies()
  }

  useEffect(() => {
    getMovies()
  }, [])

  return (
    <>
      {loading ? <h1>Loading...</h1> : null}
    </>
  );
}

export default App;
